import Home, {setPage} from "./Home";
import Sobre from "./Sobre";

function Content({page, setPage}) {
    const pages = {    
        "Sobre": <Sobre />,
        "Home": <Home />,
    };

    return (
        <div className="row m-3">
            {pages[page] || <p>Página não encontrada.</p>}
        </div>
    );
};

export default Content;
